import React, { Component } from "react";

import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {};
  }
  render() {
    return (
      <div className="App">
        <h1>StopWatch</h1>
        <div className="screen" />
        <div className="btns">
          <button className="btn-1">Start</button>
          <button className="btn-2">Reset</button>
        </div>
      </div>
    );
  }
}

export default App;
